import { combineReducers } from "redux";

function currWord(state = '', action) {
    if (action.type === 'RESET'){
        return '';
    } else if (action.type === 'DEL'){
        return action.value;
    }
    return state;
}

function fiveReducer(state = [], action){
    if (action.type === 'FIVE'){
        state = action.value;
        return state;
    } else if (action.type === 'ResetWord'){
        return [];
    }
    return state;
}

function wordList(state = [], action){
    if (action.type === 'LIST'){
        state.push(action.value)
        state = [...state]
        return state;
    } else if (action.type === 'ResetList'){
        return [];
    }
    return state;
}

function golbPick(state = '', action){
    if (action.type === 'CHANGE'){
        return action.value;
    }
    return state;
}


function medWord(state = '', action) {
    if (action.type === 'RESETMED'){
        return '';
    } else if (action.type === 'DELMED'){
        return action.value;
    }
    return state;
}

function sixReducer(state = [], action){
    if (action.type === 'SIX'){
        state = action.value;
        return state;
    } else if (action.type === 'ResetWordMED'){
        return [];
    }
    return state;
}

function wordListMed(state = [], action){
    if (action.type === 'LISTMED'){
        state.push(action.value)
        state = [...state]
        return state;
    } else if (action.type === 'ResetListMED'){
        return [];
    }
    return state;
}

function golbPickMed(state = '', action){
    if (action.type === 'CHANGEMED'){
        return action.value;
    }
    return state;
}



export default combineReducers({
    curr: currWord,
    five: fiveReducer,
    list: wordList,
    pick: golbPick,
    currMed: medWord,
    six: sixReducer,
    listMed: wordListMed,
    pickMed: golbPickMed,

})
